**Describe the bug**
A clear and concise description of what the bug is.

**To Reproduce**
Steps to reproduce the behavior:
``` ts
import { KeyPair } from "near-api-js";

const pk = 'ed25519:23kAtJfnTGjb5p1gtjXxH7RYFzbB3gmBNBGiTB3av9UvygLW3x9zYrwuj6WiH2AGHc5hk2nkD9213MeKV3PEkias';
const keypair = KeyPair.fromString(pk);

const message = Buffer.from("Sign to me please");
const { signature } = keypair.sign(message);

console.warn(keypair.verify(message, signature));
// false
```

**Expected behavior**
`keypair.verify` should return true.

**Desktop (please complete the following information):**
 - OS: Ubuntu
 - Version:  20.04.4 LTS

