Jira Link: [DB-3095](
### Description

IN query does not return the right values when one element in the search key exceeds the numerical limit in a range split table.

Example: 
```
CREATE TABLE test (key smallint, val int, PRIMARY KEY(key ASC));
INSERT INTO test VALUES (1, 1);
INSERT INTO test VALUES (6, 6);
INSERT INTO test VALUES (11, 11);
INSERT INTO test VALUES (16, 16);

yugabyte=# SELECT * from test;
 key | val
-----+-----
   1 |   1
   6 |   6
  11 |  11
  16 |  16
(4 rows)

yugabyte=# SELECT * FROM test WHERE key in (1, 6);
 key | value
-----+-------
   1 |     1
   6 |     6
(2 rows)

yugabyte=# SELECT * FROM test WHERE key IN (1, 6::bigint);
 key | value
-----+-------
   1 |     1
   6 |     6
(2 rows)

-- WRONG RESULT
yugabyte=# SELECT * FROM test WHERE key IN (1, 40000);
 key | value
-----+-------
(0 rows)

yugabyte=# SELECT * FROM test WHERE where key IN (1, 4000000);
 key | value
-----+-------
   1 |     1
(1 row)

-- WRONG RESULT
yugabyte=# SELECT * FROM test WHERE where key IN ();
 key | value
-----+-------
(0 rows)

yugabyte=# SELECT * FROM test WHERE where key IN ();
 key | value
-----+-------
   1 |     1
   6 |     6
(2 rows)

```

The docDB RPC that is sent for the following request  `SELECT * FROM test WHERE where key IN ();`
is as follows 

```
I0801 09:24: 183961088 :213
]Applying operation:{
   READ active:1 read_time:{
      read: local_limit: global_limit: in_txn_limit: serial_no:0
   }request:client:YQL_CLIENT_PGSQL stmt_id:4451389536 schema_version:0 targets{
      column_id:0
   }targets{
      column_id:1
   }targets{
      column_id:-8
   }column_refs{
      ids:0 ids:1
   }is_forward_scan:1 is_aggregate:0 limit:1024 return_paging_state:1 ysql_catalog_version:4 table_id:000033e100003000800000000000400dcondition_expr{
      condition{
         op:QL_OP_AND operands{
            condition{
               op:QL_OP_IN operands{
                  column_id:0
               }operands{
                  value{
                     list_value{
                        elems{
                           int16_value:1
                        }elems{
                           int16_value:6
                        }elems{
                           int16_value:-25536
                        }
                     }
                  }
               }
            }
         }
      }
   }upper_bound{
      key:487FFF9C407E21is_inclusive:1
   }col_refs{
      column_id:0 attno:1
   }col_refs{
      column_id:1 attno:2
   }partition_key:488000000121
}
```

We can see that the value list for 40000 is -25536, which is the overflown value. There are two issues here.
1. We could avoid pushing it to docDB --> [Issue 22974]( is fixing that. But that works for only inequalities. Elements in a search array are part of equality conditions. Hence we have to deal with that in a different manner.

### Describe the bug

Just tried out ImageOptimize 4.0.0-beta.1 on Craft 4.0.0-beta4. Trying to upload an image on the asset page to an asset volume that has an optimized Images field fails. The loading bar never disappears and the console throws an error. 
Uploading works fine if the asset volume doesn't have an optimized images field. 
Removing the field, then uploading images and then reapplying the field again works as well, and after adding it, transforms will be generated as expected. 

